import React, {Component} from 'react';
import{Row, Col} from "antd"; //整体布局是行列式

import SatSetting from "./SatSetting";

class Main extends Component {
    render() {
        return (
            <Row className="main">
                <Col
                    className="left-side"
                    span = {8}
                >
                    <SatSetting />
                </Col>
                <Col
                    className="right-side"
                    span = {16}
                >right</Col>
            </Row>
        );
    }
}

export default Main;
